(18337, 18416, 0, 1, 1, 'Your answer is correct.<p>Generally electrolytic capacitor is used to provide large value of capacitance. The large capacitance of electrolytic capacitors makes them particularly suitable for passing or bypassing low-frequency signals, and for storing large amounts of energy. They are widely used for decoupling or noise filtering in power supplies and DC link circuits for variable frequency drives, for coupling signals<br></p>', 1, '<p>Your answer is&nbsp;&nbsp;&nbsp;partially correct<br></p><p></p><p></p>', 1, 'Your answer is incorrect.<p>Generally electrolytic capacitor is used to provide large value of capacitance. The large capacitance of electrolytic capacitors makes them particularly suitable for passing or bypassing low-frequency signals, and for storing large amounts of energy. They are widely used for decoupling or noise filtering in power supplies and DC link circuits for variable frequency drives, for coupling signals<br></p>', 1, 'abc', 1, 0),
(18338, 18417, 0, 1, 1, 'Your answer is correct.', 1, 'Voltage applied across ceramic dielectric produces electrostatic field 100 times greater than in air then the dielectric constant of ceramic will also 100 because, the amount of electrostatic field is directly proportional to relative permittivity. This relative permittivity is called as dielectric constant.', 1, 'Your answer is incorrect.', 1, 'abc', 1, 0),
(18339, 18418, 0, 1, 1, 'Your answer is correct.<p>Voltage applied across ceramic dielectric produces electrostatic field 100 times greater than in air then the dielectric constant of ceramic will also 100 because, the amount of electrostatic field is directly proportional to relative permittivity. This relative permittivity is called as dielectric constant.<br></p>', 1, '&nbsp;Your answer is&nbsp;&nbsp;partially correct', 1, 'Your answer is incorrect.<p>Voltage applied across ceramic dielectric produces electrostatic field 100 times greater than in air then the dielectric constant of ceramic will also 100 because, the amount of electrostatic field is directly proportional to relative permittivity. This relative permittivity is called as dielectric constant.<br></p>', 1, 'abc', 1, 0),
(18340, 18419, 0, 1, 1, 'Your answer is correct.<p>A real capacitor has a leakage resistance internally. It can be said as a large resistance in parallel with capacitor. While the leakage current flowing in it, and then I 2R loss is produced due to that leakage resistance. Hence, the internal loss happens due to the leakage power loss inside the capacitor.<br></p>', 1, 'Your answer is&nbsp;partially correct', 1, 'Your answer is incorrect.<p>A real capacitor has a leakage resistance internally. It can be said as a large resistance in parallel with capacitor. While the leakage current flowing in it, and then I 2R loss is produced due to that leakage resistance. Hence, the internal loss happens due to the leakage power loss inside the capacitor.<br></p>', 1, 'abc', 1, 0),
(18341, 18420, 0, 1, 1, 'Your answer is correct.<p>during discharging the voltage of cell decreases whereas during charging voltage of cell increases<br></p>', 1, 'Your answer is&nbsp;partially correct', 1, 'Your answer is incorrect.<p>during discharging the voltage of cell decreases whereas during charging voltage of cell increases<br></p>', 1, 'abc', 1, 0),
(18342, 18421, 0, 1, 0, 'Your answer is correct.', 1, 'watt hours efficiency of the battery is more. Normally lead acid battery are having the watt-hour efficiency between 70 to 80%.', 1, 'Your answer is incorrect.', 1, 'abc', 1, 0);
