(18347, 18426, 0, 1, 1, 'your answer is correct.<p>sol: centrifugal force pushes the car outwards. Since the center of mass of the car is above the level of the wheels, it tends to create a moment which pushes the outer wheels down and the inner wheels up. Since the outer wheels are being pushed downwards, the ground exerts a greater normal force on the outer wheels<br></p>', 1, 'Your answer is partially correct.', 1, 'Sol.<p>&nbsp;centrifugal force pushes the car outwards. Since\r\nthe center of mass of the car is above the level of\r\nthe wheels, it tends to create a moment which\r\npushes the outer wheels down and the inner wheels\r\nup. Since the outer wheels are being pushed\r\ndownwards, the ground exerts a greater normal\r\nforce on the outer wheels</p>', 1, 'abc', 1, 0),
