(18349, 18428, 0, 1, 0, 'Your answer is correct.', 1, 'Dielectric used for making capacitor should have high permeability. Because the capacitance of capacitor is directly proportional to the dielectric permeability. If dielectric permeability will high then capacitance of capacitor will also high.', 1, 'Your answer is incorrect.', 1, 'abc', 1, 0),
(18350, 18429, 0, 1, 0, 'Your answer is correct.', 1, '&nbsp;Materials which are required to retain their magnetism will have a fairly high retentivity and as such are used to make permanent magnets, while those materials required to lose their magnetism quickly such as soft iron cores for relays and solenoids will have a very low retentivity. Low retentivity materials are also suitable for making temporary magnets.', 1, 'Your answer is incorrect.', 1, 'abc', 1, 0),
