(18469, 18549, 0, 1, 1, 'Your answer is correct.<p>Sol. Alloy steel is a type of steel that has presence of\r\ncertain other elements apart from iron and carbon.\r\nCommonly added elements in alloy steel are\r\nmanganese, silicon, boron, chromium, vanadium\r\nand nickel. The quantity of these metals in alloy\r\nsteel is primarily dependent upon the use of such\r\nsteel. Normally alloy steel is made to get desired\r\nphysical characteristics in the steel.\r\nCarbon steel is also known as plain steel and is an\r\nalloy of steel where carbon is the main constituent\r\nand no minimum percentage of other alloying\r\nelements is mentioned. Carbon steel is not stainless\r\nsteel as it is classified under alloy steels. As the\r\nname implies, carbon content is increased in the\r\nsteel making it harder and stronger through\r\napplication of heat treatments. However, addition\r\nof carbon makes the steel less ductile. The\r\nweldability of carbon steel is low and higher carbon\r\ncontent also lowers the melting point of the alloy.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. Alloy steel is a type of steel that has presence of\r\ncertain other elements apart from iron and carbon.\r\nCommonly added elements in alloy steel are\r\nmanganese, silicon, boron, chromium, vanadium\r\nand nickel. The quantity of these metals in alloy\r\nsteel is primarily dependent upon the use of such\r\nsteel. Normally alloy steel is made to get desired\r\nphysical characteristics in the steel.\r\nCarbon steel is also known as plain steel and is an\r\nalloy of steel where carbon is the main constituent\r\nand no minimum percentage of other alloying\r\nelements is mentioned. Carbon steel is not stainless\r\nsteel as it is classified under alloy steels. As the\r\nname implies, carbon content is increased in the\r\nsteel making it harder and stronger through\r\napplication of heat treatments. However, addition\r\nof carbon makes the steel less ductile. The\r\nw