(18524, 18604, 0, 1, 1, 'Your answer is correct.<p>In Squirrel cage rotor, slots in\r\nlamination or rotor core is not made parallel to the rotor shaft. A slight\r\nangle is maintained due to some\r\nadvantages. This is called the rotor\r\nSkew.\r\nSkew helps to make the motor run\r\nquietly by reducing the magnetic\r\nhum. It reduce rotor locking\r\ntendency. Rotor locking tendency\r\noccurs when rotor teeth remain\r\ndirectly under stator teeth thus they\r\nmight be magnetically attracted</p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>In Squirrel cage rotor, slots in lamination or rotor core is not made parallel to the rotor shaft. A slight angle is maintained due to some advantages. This is called the rotor Skew. Skew helps to make the motor run quietly by reducing the magnetic hum. It reduce rotor locking tendency. Rotor locking tendency occurs when rotor teeth remain directly under stator teeth thus they might be magnetically attracted</p><p><br></p>', 1, 'abc', 1, 0),
