(18531, 18611, 0, 1, 1, 'Your answer is correct.<p>In ward-Leonard method, very fine\r\nspeed control over the whole range\r\nfrom zero to normal speed in both\r\ndirections can be obtained. The\r\nmotor-generator set can provide\r\nspeed both below and above the\r\nrated speed and in both direction. In\r\ncase of colliery winders fine speed\r\ncontrol required.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>In ward-Leonard method, very fine\r\nspeed control over the whole range\r\nfrom zero to normal speed in both\r\ndirections can be obtained. The\r\nmotor-generator set can provide\r\nspeed both below and above the\r\nrated speed and in both direction. In\r\ncase of colliery winders fine speed\r\ncontrol required.<br></p>', 1, 'abc', 1, 0),
