(18533, 18613, 0, 1, 0, 'Your answer is correct.<p>In DC machine One way to reduce\r\nthe effects of armature reaction is to\r\nplace small auxiliary poles called\r\n\"inter poles\" between the main field\r\npoles. in Generators the inter poles\r\nhave a few turns of large wire and\r\nare connected in series with the\r\narmature<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>In DC machine One way to reduce\r\nthe effects of armature reaction is to\r\nplace small auxiliary poles called\r\n\"inter poles\" between the main field\r\npoles. in Generators the inter poles\r\nhave a few turns of large wire and\r\nare connected in series with the\r\narmature<br></p>', 1, 'abc', 1, 0),
(18534, 18614, 0, 1, 1, 'Your answer is correct.<p>Sol. Sensible heat is the heat (energy) in the air due\r\nto the temperature of the air and the latent heat is\r\nthe heat (energy) in the air due to the moisture of\r\nthe air. So for sensible cooling no change in\r\nmoisture content hence specific humidity remain\r\nconstant.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. Sensible heat is the heat (energy) in the air due\r\nto the temperature of the air and the latent heat is\r\nthe heat (energy) in the air due to the moisture of\r\nthe air. So for sensible cooling no change in\r\nmoisture content hence specific humidity remain\r\nconstant.<br></p>', 1, 'abc', 1, 0),
(18535, 18615, 0, 1, 0, 'Your answer is correct.<p>Current produced by the relative\r\nmotion of stator/rotor conductor or\r\nmagnet is called induced current, set\r\nup by an induced electromotive force\r\nor EMF. The production of EMF in a\r\ncoil is called the phenomenon of\r\nELECTROMAGNETIC INDUCTION.\r\nEMF is produced when a current\r\ncarrying conductor placed in a\r\nrotating magnetic field. Where either\r\nfield is rotating or conductor.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Current produced by the relative\r\nmotion of stator/rotor conductor or\r\nmagnet is called induced current, set\r\nup by an induced electromotive force\r\nor EMF. The production of EMF in a\r\ncoil is called the phenomenon of\r\nELECTROMAGNETIC INDUCTION.\r\nEMF is produced when a current\r\ncarrying conductor placed in a\r\nrotating magnetic field. Where either\r\nfield is rotating or conductor.<br></p>', 1, 'abc', 1, 0),
(18536, 18616, 0, 1, 1, 'Your answer is correct.<p><img src=\"@@PLUGINFILE@@/image.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br></p><p>In above fig. the wet bulb temperature is shown as\r\ndotted line. Which is straight inclined sloping\r\ndownward to the right<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><img src=\"@@PLUGINFILE@@/image.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br></p><p>In above fig. the wet bulb temperature is shown as\r\ndotted line. Which is straight inclined sloping\r\ndownward to the right<br></p>', 1, 'abc', 1, 0),
(18537, 18617, 0, 1, 1, 'Your answer is correct.<p>Sol. The dew point temperature is the temperature\r\nto which the air must be cooled before dew or frost\r\nbegins to form. The dew point temperature is also a\r\nmeasure of the amount of water vapor in the\r\ncurrent air mass. The higher the dew point, the\r\nmore water vapor there is in the air. knowing the&nbsp;dew point gives an idea of how moist or dry the air\r\nis<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. The dew point temperature is the temperature\r\nto which the air must be cooled before dew or frost\r\nbegins to form. The dew point temperature is also a\r\nmeasure of the amount of water vapor in the\r\ncurrent air mass. The higher the dew point, the\r\nmore water vapor there is in the air. knowing the&nbsp;dew point gives an idea of how moist or dry the air\r\nis<br></p>', 1, 'abc', 1, 0),
(18538, 18618, 0, 1, 0, 'Your answer is correct.<p>&nbsp;The cross-magnetizing effect of\r\narmature reaction may cause trouble\r\nin d.c. machines subjected to large\r\nfluctuations in load. In order to\r\nneutralize the cross magnetizing\r\neffect of armature reaction, a\r\ncompensating winding is used. The\r\ncompensating windings consist of a\r\nseries of coils embedded in slots in\r\nthe pole faces. These coils are\r\nconnected in series with the\r\narmature. The number of turns in\r\nthe compensating winding are\r\nalways less than number of armature\r\nconductors.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>&nbsp;The cross-magnetizing effect of\r\narmature reaction may cause trouble\r\nin d.c. machines subjected to large\r\nfluctuations in load. In order to\r\nneutralize the cross magnetizing\r\neffect of armature reaction, a\r\ncompensating winding is used. The\r\ncompensating windings consist of a\r\nseries of coils embedded in slots in\r\nthe pole faces. These coils are\r\nconnected in series with the\r\narmature. The number of turns in\r\nthe compensating winding are\r\nalways less than number of armature\r\nconductors.<br></p>', 1, 'abc', 1, 0),
(18539, 18619, 0, 1, 1, 'Your answer is correct.<p>Sol. The process in which the air is cooled sensibly\r\nand at the same time the moisture is removed from\r\nit is called as cooling and dehumidification process.\r\nCooling and dehumidification process is obtained\r\nwhen the air at the given dry bulb and dew point\r\n(DP) temperature is cooled below the dew point\r\ntemperature<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. The process in which the air is cooled sensibly\r\nand at the same time the moisture is removed from\r\nit is called as cooling and dehumidification process.\r\nCooling and dehumidification process is obtained\r\nwhen the air at the given dry bulb and dew point\r\n(DP) temperature is cooled below the dew point\r\ntemperature<br></p>', 1, 'abc', 1, 0),
(18540, 18620, 0, 1, 0, 'Your answer is correct.<p>&nbsp;Power input for Hopkinson test for\r\ngiven rating machines should be 100\r\nkW.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>&nbsp;Power input for Hopkinson test for\r\ngiven rating machines should be 100\r\nkW.<br></p>', 1, 'abc', 1, 0),
(18541, 18621, 0, 1, 1, 'Your answer is correct.<p>A commutator consists of a set of\r\ncopper segments, fixed around the\r\npart of the circumference of the\r\nrotating machine, or the rotor.\r\nCommutator segments are\r\nconnected in series with the coils of\r\nthe armature, with the number of\r\ncoils (and commutator segments)\r\ndepending on the speed and voltage\r\nof the machine.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>A commutator consists of a set of\r\ncopper segments, fixed around the\r\npart of the circumference of the\r\nrotating machine, or the rotor.\r\nCommutator segments are\r\nconnected in series with the coils of\r\nthe armature, with the number of\r\ncoils (and commutator segments)\r\ndepending on the speed and voltage\r\nof the machine.<br></p>', 1, 'abc', 1, 0),
(18542, 18622, 0, 1, 1, 'Your answer is correct.<p>Frequency changers are used for\r\nconverting bulk AC power from one\r\nfrequency to another, The speed of\r\nan AC motor is dependent on the\r\nfrequency of the AC power supply,\r\nso changing frequency allows the\r\nmotor speed to be changed. This\r\nallows fan or pump output to be\r\nvaried to match process conditions,\r\nwhich can provide energy savings.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Frequency changers are used for\r\nconverting bulk AC power from one\r\nfrequency to another, The speed of\r\nan AC motor is dependent on the\r\nfrequency of the AC power supply,\r\nso changing frequency allows the\r\nmotor speed to be changed. This\r\nallows fan or pump output to be\r\nvaried to match process conditions,\r\nwhich can provide energy savings.<br></p>', 1, 'abc', 1, 0),
(18543, 18623, 0, 1, 1, 'Your answer is correct.<p>For hoisting and lowering of crane\r\nrequires high starting torque. Hence\r\nac slip ring induction motor, Ward\r\nLeonard controlled DC shunt motors\r\nare preferred.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>For hoisting and lowering of crane\r\nrequires high starting torque. Hence\r\nac slip ring induction motor, Ward\r\nLeonard controlled DC shunt motors\r\nare preferred.<br></p>', 1, 'abc', 1, 0),
(18544, 18624, 0, 1, 0, 'Your answer is correct.<p>&nbsp;Light duty cranes design promote\r\neasy installation and smooth,\r\nrepetitive, robust lifting. Light duty\r\ncranes are used in –\r\nAutomobile workshop, Pumping\r\nstation and Power houses etc.<br></p>', 1, 'Your answer is partially correct.<p>Light duty cranes design promote\r\neasy installation and smooth,\r\nrepetitive, robust lifting. Light duty\r\ncranes are used in –\r\nAutomobile workshop, Pumping\r\nstation and Power houses etc.<br></p>', 1, 'Your answer is incorrect.', 1, 'abc', 1, 0),
