(18546, 18626, 0, 1, 0, 'Your answer is correct.<p>free running and costing period of\r\nmain line service is long because we\r\ncan not shut down main line during\r\nmaintenance. It requires service\r\nduring running condition.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>free running and costing period of\r\nmain line service is long because we\r\ncan not shut down main line during\r\nmaintenance. It requires service\r\nduring running condition.<br></p>', 1, 'abc', 1, 0),
(18547, 18627, 0, 1, 1, 'Your answer is correct.<p>Arc blow is the undesirable effect of\r\na wandering welding arc during arc\r\nwelding. They are two kinds of arc\r\nblow: Magnetic and Thermal.\r\nMagnetic arc blow or \"arc wander\" is\r\nthe deflection of welding filler\r\nmaterial within an electric arc\r\ndeposit by a build up of magnetic\r\nforce surrounding the weld pool.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Arc blow is the undesirable effect of\r\na wandering welding arc during arc\r\nwelding. They are two kinds of arc\r\nblow: Magnetic and Thermal.\r\nMagnetic arc blow or \"arc wander\" is\r\nthe deflection of welding filler\r\nmaterial within an electric arc\r\ndeposit by a build up of magnetic\r\nforce surrounding the weld pool.<br></p>', 1, 'abc', 1, 0),
(18548, 18628, 0, 1, 1, 'Your answer is correct.<p>reserve energy which is currently\r\ncold. Refers specifically to energy\r\nproduced by thermal generators\r\nwhich is available but not currently\r\noperating, and derives from the fact\r\nthat an available, nonfunctional oven\r\nor steam boiler is colder than one\r\nwhich is in operation.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>reserve energy which is currently\r\ncold. Refers specifically to energy\r\nproduced by thermal generators\r\nwhich is available but not currently\r\noperating, and derives from the fact\r\nthat an available, nonfunctional oven\r\nor steam boiler is colder than one\r\nwhich is in operation.<br></p>', 1, 'abc', 1, 0),
(18549, 18629, 0, 1, 1, 'Your answer is correct.<p>The primary step down sub stations\r\nare created nearer to load center\r\nalong the primary transmission lines.\r\nHere primary transmission voltages\r\nare stepped down to different\r\nsuitable voltages for secondary\r\ntransmission purpose.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>The primary step down sub stations\r\nare created nearer to load center\r\nalong the primary transmission lines.\r\nHere primary transmission voltages\r\nare stepped down to different\r\nsuitable voltages for secondary\r\ntransmission purpose.<br></p>', 1, 'abc', 1, 0),
(18550, 18630, 0, 1, 0, 'Your answer is correct.<p>&nbsp;The primary reason that power is\r\ntransmitted at high voltages is to\r\nincrease efficiency. As electricity is\r\ntransmitted over long distances,\r\nthere are inherent energy losses\r\nalong the way. High voltage\r\ntransmission minimizes the amount\r\nof power lost as electricity flows from\r\none location to the next. How? The\r\nhigher the voltage, the lower the\r\ncurrent. The lower the current, the\r\nlower the resistance in the\r\nconductors. And when resistance is\r\nlow, energy losses are low also.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>The primary reason that power is\r\ntransmitted at high voltages is to\r\nincrease efficiency. As electricity is\r\ntransmitted over long distances,\r\nthere are inherent energy losses\r\nalong the way. High voltage\r\ntransmission minimizes the amount\r\nof power lost as electricity flows from\r\none location to the next. How? The\r\nhigher the voltage, the lower the\r\ncurrent. The lower the current, the\r\nlower the resistance in the\r\nconductors. And when resistance is\r\nlow, energy losses are low also.<br></p>', 1, 'abc', 1, 0),
(18551, 18631, 0, 1, 0, 'Your answer is correct.<p>Required Properties in Materials\r\nUsed for Conductor in\r\nTransmission Line&nbsp;</p><p>1. High conductivity&nbsp;</p><p>2. High tensile strength&nbsp;</p><p>3. Light weight&nbsp;</p><p>4. High resistance to corrosion in\r\nwhether conditions</p><p>5. High thermal stability</p><p>&nbsp;6. Low coefficient of thermal\r\nexpansion&nbsp;</p><p>7. Low cost<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Required Properties in Materials\r\nUsed for Conductor in\r\nTransmission Line&nbsp;</p><p>1. High conductivity&nbsp;</p><p>2. High tensile strength&nbsp;</p><p>3. Light weight&nbsp;</p><p>4. High resistance to corrosion in\r\nwhether conditions</p><p>5. High thermal stability&nbsp;</p><p>6. Low coefficient of thermal\r\nexpansion&nbsp;</p><p>7. Low cost<br></p>', 1, 'abc', 1, 0),
