(18555, 18635, 0, 1, 1, 'Your answer is correct.<p>Sol:<br><p>As the temperature of air increases average kinetic\r\nenergy of the molecules increases, thus the\r\naverage speed of molecules increases, thus the\r\ncollision rate of the molecules increases. In air the\r\nthermal (kinetic energy of molecules) energy\r\nbetween the molecules is transported when they\r\ncollide. So if the collision rate is more the rate of\r\ntransportation of thermal energy between the\r\nmolecules is more. Thus the conductivity of air\r\nincreases with temperature.<br></p></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:<br><p>As the temperature of air increases average kinetic\r\nenergy of the molecules increases, thus the\r\naverage speed of molecules increases, thus the\r\ncollision rate of the molecules increases. In air the\r\nthermal (kinetic energy of molecules) energy\r\nbetween the molecules is transported when they\r\ncollide. So if the collision rate is more the rate of\r\ntransportation of thermal energy between the\r\nmolecules is more. Thus the conductivity of air\r\nincreases with temperature.<br></p></p>', 1, 'abc', 1, 0),
