(18631, 18711, 0, 1, 1, 'Your answer is correct.<p>Sol: Under \'Income Tax Informants Reward Scheme\' a person can get reward up to Rs. 50 lakhs for giving specific information about substantial evasion of tax on income or assets in India.</p><p>• A reward of up to Rs 1 crore - The tax department announced two reward schemes under which informants sharing ‘specific information’ about any Benami transaction or property could get a reward of up to Rs 1 crore.</p><p>• A reward of up to Rs 5 crore - Information on undisclosed black money stashed abroad could fetch up to Rs 5 crore for the informant.</p><p>• Reward of up to Rs 50 lakh - According to the department’s announcement, the ‘Income Tax Informants Reward Scheme’ too has been amended, under which a person can get reward up to Rs 50 lakh for giving specific information about substantial evasion of tax on income or assets in India, which are actionable under the Income-tax Act, 1961.</p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol: Under \'Income Tax Informants Reward Scheme\' a person can get reward up to Rs. 50 lakhs for giving specific information about substantial evasion of tax on income or assets in India.</p><p><p>• A reward of up to Rs 1 crore - The tax department announced two reward schemes under which informants sharing ‘specific information’ about any Benami transaction or property could get a reward of up to Rs&nbsp; crore.</p><p>• A reward of up to Rs 5 crore - Information on undisclosed black money stashed abroad could fetch up to Rs 5 crore for the informant.</p><p>• Reward of up to Rs 50 lakh - According to the department’s announcement, the ‘Income Tax Informants Reward Scheme’ too has been amended, under which a person can get reward up to Rs 50 lakh for giving specific information about substantial evasion of tax on income or assets in India, which are actionable under the Income-tax Act, 1961.<br></p><br></p><p><br></p><p><br></p><p><p><br></p></p><p><br></p><br></p>', 1, 'abc', 1, 0),
