(18646, 18726, 0, 1, 1, 'Your answer is correct.<p>Sol:&nbsp;<div>Statement 1: time taken by B to do the work alone is</div><div>1/20-1/30 = 1/60 = 60 days.\r\n</div><div>But this statement alone is not sufficient to answer\r\n</div><div>the question.\r\n</div><div>Statement 2: we only know that C will take twice as\r\n</div><div>many days as B, but we cannot find the number of\r\n</div><div>days that A will take to complete the work.\r\n</div><div>On combining 1 &amp; 2: C will take 120 days to\r\n</div><div>complete the work.\r\n</div><div>1/A+ 1/C =1/30\r\n</div><div>1/A+ 1/120 = 1/30\r\n</div><div>1/A= 1/30-1/120= (4-1)/120= 3/120 = 1/40\r\n</div><div>A take 40 days to complete a work, working alone.\r\n</div><div>Both statements are required to answer the question.</div></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:&nbsp;<div>Statement 1: time taken by B to do the work alone is</div><div>1/20-1/30 = 1/60 = 60 days.\r\n</div><div>But this statement alone is not sufficient to answer\r\n</div><div>the question.\r\n</div><div>Statement 2: we only know that C will take twice as\r\n</div><div>many days as B, but we cannot find the number of\r\n</div><div>days that A will take to complete the work.\r\n</div><div>On combining 1 &amp; 2: C will take 120 days to\r\n</div><div>complete the work.\r\n</div><div>1/A+ 1/C =1/30\r\n</div><div>1/A+ 1/120 = 1/30\r\n</div><div>1/A= 1/30-1/120= (4-1)/120= 3/120 = 1/40\r\n</div><div>A take 40 days to complete a work, working alone.\r\n</div><div>Both statements are required to answer the\r\n</div><div>question.\r\n</div></p>', 1, 'abc', 1, 0),
