(18649, 18729, 0, 1, 1, 'Your answer is correct.<p>Sol:&nbsp;Question Type: What Is the Value? This question\r\nasks for the final score of a game between two\r\nteams, X and Y.</p><p>Given information from the question stem: This\r\nquestion is seeking a specific value for the final\r\nscore in game between team X and team Y.<br></p><p>Statement 1: This statement tells you that the firsthalf score for X + 14 = the Second Half Score for X.\r\nThis statement is clearly not sufficient as it does not\r\ngive you a score for either team X or Team Y.\r\nEliminate choices A and D.<br></p><p>Statement 2: This statement tells you that during\r\nthe first half the two teams scored equal points but\r\nthat during the second half team y scored 4 more&nbsp;points. This statement also does not give you any\r\nfixed value for the score of X or of Y. Also not\r\nsufficient: Eliminate choice B.<br></p><p>Together: Even taken together these two\r\nstatements do not yield enough information.\r\nNeither statement gives you an actual number.\r\nPlaying Devil’s Advocate, you could simply choose\r\n10 as the number of points each team scored in the\r\nfirst half. Then add 14 points to X’s first-half score\r\nto get the second-half score according to Statement\r\n1, so x would score 10+24 = 34 points. Y scored 4\r\nmore than X (Statement 2) so that would mean 38\r\npoints for Y. But there is no reason why “10” should\r\nbe the first-half score any more than “20” or “100.”\r\nThis question allows for an infinite variety of final\r\nscores. The information is not sufficient. The\r\nanswer is E.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol:&nbsp;Question Type: What Is the Value? This question asks for the final score of a game between two teams, X and Y.</p><p>Given information from the question stem: This question is seeking a specific value for the final score in game between team X and team Y.<br></p><p>Statement 1: This statement tells you that the firsthalf score for X + 14 = the Second Half Score for X. This statement is clearly not sufficient as it does not give you a score for either team X or Team Y. Eliminate choices A and D.<br></p><p>Statement 2: This statement tells you that during the first half the two teams scored equal points but that during the second half team y scored 4 more&nbsp;points. This statement also does not give you any fixed value for the score of X or of Y. Also not sufficient: Eliminate choice B.<br></p><p>Together: Even taken together these two statements do not yield enough information. Neither statement gives you an actual number. Playing Devil’s Advocate, you could simply choose 10 as the number of points each team scored in the first half. Then add 14 points to X’s first-half score to get the second-half score according to Statement 1, so x would score 10+24 = 34 points. Y scored 4 more than X (Statement 2) so that would mean 38 points for Y. But there is no reason why “10” should be the first-half score any more than “20” or “100.” This question allows for an infinite variety of final scores. The information is not sufficient. The answer is E.</p><br></p>', 1, 'abc', 1, 0),
