(18651, 18731, 0, 1, 1, 'Your answer is correct.<p>Sol:&nbsp;Question Type: What Is the Value? This question\r\nasks you for the number of units that line A\r\nproduced in 2006.</p><p>Given information from the question stem:\r\nProduction on line A increased by 5% from 2006 to\r\n2007 and production on line B increased by 10%.\r\nStatement 1: This statement can be written as “A +\r\nB = 100,000 units.” This information is not\r\nsufficient since you do not know how many of the\r\n100,000 units were produced by line A and how\r\nmany by line B. Not sufficient. Eliminate answers A\r\nand D.<br></p><p>Statement 2: This statement tells you the combined\r\nnumber of units in 2007. This can be written as\r\n1.05A + 1.10B = 107,500. Similar to the above,\r\nthis statement is not sufficient alone as you have\r\ntwo variables and one equation. Eliminate choice B\r\nas well.<br></p><p>Together: Now you have two distinct linear\r\nequations with two variables and you can solve.\r\nThere is no need to actually solve for A since you\r\nare certain that you can. Together the statements\r\nare sufficient and the answer is C.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol:&nbsp;Question Type: What Is the Value? This question asks you for the number of units that line A produced in 2006.</p><p>Given information from the question stem: Production on line A increased by 5% from 2006 to 2007 and production on line B increased by 10%. Statement 1: This statement can be written as “A + B = 100,000 units.” This information is not sufficient since you do not know how many of the 100,000 units were produced by line A and how many by line B. Not sufficient. Eliminate answers A and D.<br></p><p>Statement 2: This statement tells you the combined number of units in 2007. This can be written as 1.05A + 1.10B = 107,500. Similar to the above, this statement is not sufficient alone as you have two variables and one equation. Eliminate choice B as well.<br></p><p>Together: Now you have two distinct linear equations with two variables and you can solve. There is no need to actually solve for A since you are certain that you can. Together the statements are sufficient and the answer is C.</p></p>', 1, 'abc', 1, 0),
(18652, 18732, 0, 1, 1, 'Your answer is correct.<p>Sol:&nbsp;Question Type: What Is the Value? This question\r\nasks for the dollar expenditure on hops.&nbsp;</p><p>Given information from the question stem: H + Y +\r\nM = $100,000 (H = amount spent on hops, Y =\r\namount spent on yeast, M = amount spent on\r\nmalt).&nbsp;</p><p>Statement 1: Y = 1.2M. This would be sufficient if\r\nthe equation in the facts only included these two\r\nvariables. But with three variables in the above&nbsp;equation, there is no way to distribute the\r\n$100,000. This statement is not sufficient.\r\nEliminate choices A and D.</p><p>Statement 2: Y + M = H. This statement seems at\r\nfirst glance to be like Statement 1. However, it\r\ncontains some hidden information. You’re solving\r\nfor H, and this statement allows you to plug in “H”\r\nfor “Y + M” in the equation Y + M + H = 100,000.\r\nIf you replace Y + M with H, you have H + H =\r\n100,000, so H must be 50,000. Note here the\r\nopportunity to Think Like the Testmaker. C is too\r\neasy an answer, as it adds a third equation to the\r\nthree-variable set-up. The testmaker is begging you\r\nto pick C, so if you initially went for that answer\r\nyou should ask yourself whether you can Leverage\r\nAssets, and here if you spend a bit more time\r\nmanipulating Statement 2 you should see that it is\r\nsufficient. Because Statement 2 is sufficient, the\r\ncorrect answer is B.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol:&nbsp;Question Type: What Is the Value? This question asks for the dollar expenditure on hops.&nbsp;</p><p>Given information from the question stem: H + Y + M = $100,000 (H = amount spent on hops, Y = amount spent on yeast, M = amount spent on malt).&nbsp;</p><p>Statement 1: Y = 1.2M. This would be sufficient if the equation in the facts only included these two variables. But with three variables in the above&nbsp;equation, there is no way to distribute the $100,000. This statement is not sufficient. Eliminate choices A and D.</p><p>Statement 2: Y + M = H. This statement seems at first glance to be like Statement 1. However, it contains some hidden information. You’re solving for H, and this statement allows you to plug in “H” for “Y + M” in the equation Y + M + H = 100,000. If you replace Y + M with H, you have H + H = 100,000, so H must be 50,000. Note here the opportunity to Think Like the Testmaker. C is too easy an answer, as it adds a third equation to the three-variable set-up. The testmaker is begging you to pick C, so if you initially went for that answer you should ask yourself whether you can Leverage Assets, and here if you spend a bit more time manipulating Statement 2 you should see that it is sufficient. Because Statement 2 is sufficient, the correct answer is B.</p><br></p>', 1, 'abc', 1, 0),
