(18672, 18752, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>In the year 2015,&nbsp;</p><p>The salary expense of a company = 16 lakhs&nbsp;</p><p>The total number of employees = 80&nbsp;</p><p>Average salary of employees = 1600000/80 = Rs.\r\n20000&nbsp;</p><p>In the year 2016,&nbsp;</p><p>The average salary of employees = Rs. 1000 +\r\nAverage salary of employees in 2015\r\n=&gt; 4000 + 20000 = Rs. 24000&nbsp;</p><p>The salary expense in 2016 = (120/100)*16 = 19.2\r\nlakhs<br></p><p></p><div>The other expense in the year 2016 = 34 lakhs\r\n</div><div>Total expense in the year 2016 = 19.2 + 34 = 53.2 lakhs</div><div>The number of employees in 2015 = 1920000/24000 = 80</div><div>The total expense in the year 2015 and 2016 is\r\n</div><div>same. So, Thetotal expense in the year 2015 = 53.2 lakhs</div><div>The other expense in the year 2015 = 53.2 – 16 = 37.2 lakhs</div><div>The average salary of employees in the year 2017 = Rs. 15000</div><div>The other expense in the year 2017 = Rs. 47.75 lakhs</div><div>The number of employees in 2017 = 80 – 5 = 75\r\n</div><div>The salary expense in 2017 = 75*15000 = 11.25 lakhs</div><div>The total expense in the year 2017 = 47.75 + 11.25 = 59 lakhs</div><img src=\"@@PLUGINFILE@@/image.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br><p></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p></p><p>Sol:</p><p>In the year 2015,&nbsp;</p><p>The salary expense of a company = 16 lakhs&nbsp;</p><p>The total number of employees = 80&nbsp;</p><p>Average salary of employees = 1600000/80 = Rs. 20000&nbsp;</p><p>In the year 2016,&nbsp;</p><p>The average salary of employees = Rs. 1000 + Average salary of employees in 2015 =&gt; 4000 + 20000 = Rs. 24000&nbsp;</p><p>The salary expense in 2016 = (120/100)*16 = 19.2 lakhs<br></p><p></p><div>The other expense in the year 2016 = 34 lakhs</div><div>Total expense in the year 2016 = 19.2 + 34 = 53.2 lakhs</div><div>The number of employees in 2015 = 1920000/24000 = 80</div><div>The total expense in the year 2015 and 2016 is</div><div>same. So, Thetotal expense in the year 2015 = 53.2 lakhs</div><div>The other expense in the year 2015 = 53.2 – 16 = 37.2 lakhs</div><div>The average salary of employees in the year 2017 = Rs. 15000</div><div>The other expense in the year 2017 = Rs. 47.75 lakhs</div><div>The number of employees in 2017 = 80 – 5 = 75</div><div>The salary expense in 2017 = 75*15000 = 11.25 lakhs</div><div>The total expense in the year 2017 = 47.75 + 11.25 = 59 lakhs</div><p></p><img src=\"@@PLUGINFILE@@/image.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br><p></p>', 1, 'abc', 1, 0),
