(18742, 18822, 0, 1, 0, 'Your answer is correct.<p>Sol:</p><p>Choice (A): Here the commuters called on the\r\nstrike in a response to the accidents which take\r\nplace due to overcrowding and are demanding\r\nincrease in the frequency of trains, assuming that if\r\nthe frequency increases, then lesser number of\r\nsuch accident would take place. Hence, (A) is an\r\nassumption.&nbsp;</p><p>Choice (B): From the statement \"increase in the\r\nnumber of overcrowding \"it can be concluded that,\r\nthe trains in the Mumbai suburban run\r\novercrowded. Hence, (B) is a conclusion&nbsp;</p><p>Choice (C): In the statement, there is no reference\r\nto intension of the railway authority. Hence, (C) is\r\nout of context&nbsp;</p><p>Choice (D): As the number of accidents is\r\nincreasing in he past one year, it can be inferred\r\nthat, the frequency of trains did not increase in\r\naccordance to the increase in the number of\r\ncommuters. Hence, (D) is an inference</p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol:</p><p>Choice (A): Here the commuters called on the strike in a response to the accidents which take place due to overcrowding and are demanding increase in the frequency of trains, assuming that if the frequency increases, then lesser number of such accident would take place. Hence, (A) is an assumption.&nbsp;</p><p>Choice (B): From the statement \"increase in the number of overcrowding \"it can be concluded that, the trains in the Mumbai suburban run overcrowded. Hence, (B) is a conclusion&nbsp;</p><p>Choice (C): In the statement, there is no reference to intension of the railway authority. Hence, (C) is out of context&nbsp;</p><p>Choice (D): As the number of accidents is increasing in he past one year, it can be inferred that, the frequency of trains did not increase in accordance to the increase in the number of commuters. Hence, (D) is an inference</p><br></p>', 1, 'abc', 1, 0),
(18743, 18823, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>At first it may seem statement I is the cause and II\r\nis effect, but the reduction in accident cannot be\r\nhappening not just because of new traffic light.\r\nKochi had old system of traffic light system, the\r\nnew system is to curb road blocks. And reduction in\r\naccident can be mainly caused by well-maintained\r\nroad, speed limits, strict checking not just by new\r\ntraffic light system. Statement I is caused by\r\nincreasing traffic block and II by any of the above\r\nmentioned reasons, so both statements are effects\r\nwith independent causes.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>At first it may seem statement I is the cause and II\r\nis effect, but the reduction in accident cannot be\r\nhappening not just because of new traffic light.\r\nKochi had old system of traffic light system, the\r\nnew system is to curb road blocks. And reduction in\r\naccident can be mainly caused by well-maintained\r\nroad, speed limits, strict checking not just by new\r\ntraffic light system. Statement I is caused by\r\nincreasing traffic block and II by any of the above\r\nmentioned reasons, so both statements are effects\r\nwith independent causes.<br></p>', 1, 'abc', 1, 0),
