(18758, 18838, 0, 1, 0, 'Your answer is correct.<p>Sol:&nbsp;People: A, B, C, D, E, F and G\r\nYear: 1950, 1953, 1961, 1968, 1972, 1985, 1996.\r\nFruits: Mango, Guava, Pomegranate, Litchi, Apple,Fig, Banana.&nbsp;</p><p>1) The sum of ages of the one who likes\r\nPomegranate and G is 103 years.\r\n(Only Possible combination is Person born in 1961\r\n(57 year) and 1972 (46 year))&nbsp;</p><p>2) The Sum of ages of B and E is 90.&nbsp;</p><p>3) B is elder than E.\r\n(Now possible combination is person born in 1950\r\n(68 year) and 1996 (22 year) and 1961 (57 year)\r\nand 1972 (33 year) but as we can see in above\r\nstatement G is born in either 1961 or 1972 hence B\r\nand E will be born in 1950 and 1996.)&nbsp;</p><p>4) The sum of ages of A and D is 115 years.\r\n(Now only possible combination is that A and D\r\neither born in 1953 (65 year) or in 1968 (50 year).&nbsp;</p><p>5) A is younger to D.</p><p><img src=\"@@PLUGINFILE@@/image.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br></p><p>6)\r\nThe one who like Pomegranate is younger to only\r\ntwo people.\r\n(Here case – 1 gets eliminateD.&nbsp;</p><p>7) F is elder to C.<br></p><p><img src=\"@@PLUGINFILE@@/image%20%281%29.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br></p><p>8) The difference between ages of A and the one\r\nwho like Guava is 15.&nbsp;</p><p>9) The difference between E and the one who like\r\nFig is 11 years.&nbsp;</p><p>10) One who like banana is younger to G.<br></p><p><img src=\"@@PLUGINFILE@@/image%20%282%29.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br></p><p>11) As many people elder to who like mango as\r\nyounger to who like banana.&nbsp;</p><p>12) The one who likes litchi is elder to the one who\r\nlikes apple.<br></p><p><img src=\"@@PLUGINFILE@@/image%20%283%29.png\" alt=\"\" role=\"presentation\" class=\"img-fluid\"><br></p><p>Above combination will be final combination.&nbsp;</p><p>1) F born in 1972. ⇒ True&nbsp;</p><p>2) G is 11-year older person born in 1972. ⇒ True&nbsp;</p><p>3) 11 year elder than person who like Litchi. ⇒\r\nFalse (as 11 year 11 younger than Litchi)&nbsp;</p><p>4) 13 year younger than person who like fig. ⇒\r\nTrue<br></p><p><br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p><br>Sol:&nbsp;People: A, B, C, D, E, F and G Year: 1950, 1953, 1961, 1968, 1972, 1985, 1996. Fruits: Mango, Guava, Pomegranate, Litchi, Apple,Fig, Banana.&nbsp;</p><p>1) The sum of ages of the one who likes Pomegranate and G is 103 years. (Only Possible combination is Person born in 1961 (57 year) and 1972 (46 year))&nbsp;</p><p>2) The Sum of ages of B and E is 90.&nbsp;</p><p>3) B is elder than E. (Now possible combination is person born in 1950 (68 year) and 1996 (22 year) and 1961 (57 year) and 1972 (33 year) but as we can see in above statement G is born in either 1961 or 1972 hence B and E will be born in 1950 and 1996.)&nbsp;</p><p>4) The sum of ages of A and D is 115 years. (Now only possible combination is that A and D either born in 1953 (65 year) or in 1968 (50 year).&nbsp;</p><p>5) A is younger to D.</p><p><img src=\"@@PLUGINFILE@@/image.png\" alt=\"\" role=\"presentation\"><br></p><p>6) The one who like Pomegranate is younger to only two people. (Here case – 1 gets eliminateD.&nbsp;</p><p>7) F is elder to C.<br></p><p><img src=\"@@PLUGINFILE@@/image%20%281%29.png\" alt=\"\" role=\"presentation\"><br></p><p>8) The difference between ages of A and the one who like Guava is 15.&nbsp;</p><p>9) The difference between E and the one who like Fig is 11 years.&nbsp;</p><p>10) One who like banana is younger to G.<br></p><p><img src=\"@@PLUGINFILE@@/image%20%282%29.png\" alt=\"\" role=\"presentation\"><br></p><p>11) As many people elder to who like mango as younger to who like banana.&nbsp;</p><p>12) The one who likes litchi is elder to the one who likes apple.<br></p><p><img src=\"@@PLUGINFILE@@/image%20%283%29.png\" alt=\"\" role=\"presentation\"><br></p><p>Above combination will be final combination.&nbsp;</p><p>1) F born in 1972. ⇒ True&nbsp;</p><p>2) G is 11-year older person born in 1972. ⇒ True&nbsp;</p><p>3) 11 year elder than person who like Litchi. ⇒ False (as 11 year 11 younger than Litchi)&nbsp;</p><p>4) 13 year younger than person who like fig. ⇒ True</p><br></p>', 1, 'abc', 1, 0),
