(18840, 18920, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>India\'s first biofuel-powered flight that aims to \r\nreduce costs of air travel by replacing the costly \r\naviation turbine fuel was successfully tested by \r\nSpiceJet. SpiceJet used its Bombardier Q400 \r\naircraft for this flight. SpiceJet is the only airline in \r\nIndia to explore aerial operations powered by BioJet \r\nfuel and intends to undertake operations using a \r\nblend of 75% of aviation turbine fuel (ATF) and \r\n25% of BioJet fuel, which has the potential of \r\nreducing carbon footprint by 15%.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>India\'s first biofuel-powered flight that aims to \r\nreduce costs of air travel by replacing the costly \r\naviation turbine fuel was successfully tested by \r\nSpiceJet. SpiceJet used its Bombardier Q400 \r\naircraft for this flight. SpiceJet is the only airline in \r\nIndia to explore aerial operations powered by BioJet \r\nfuel and intends to undertake operations using a \r\nblend of 75% of aviation turbine fuel (ATF) and \r\n25% of BioJet fuel, which has the potential of \r\nreducing carbon footprint by 15%.<br></p>', 1, 'abc', 1, 0),
