(18854, 18934, 0, 1, 1, 'Your answer is correct.<br>Sol:<p>The concerned sentence mentions a positive idea,\r\n\"Business leaders are embracing this shift in\r\nculture.\" This indicates the other aspect is also\r\nseeing a positive change. Thus, \"fuelling\" is the\r\ncorrect word for the blank.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>The concerned sentence mentions a positive idea,\r\n\"Business leaders are embracing this shift in\r\nculture.\" This indicates the other aspect is also\r\nseeing a positive change. Thus, \"fuelling\" is the\r\ncorrect word for the blank.<br></p>', 1, 'abc', 1, 0),
(18855, 18935, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>The concerned sentence mentions \"more productive\r\nways of\". This means that with the development of\r\ntechnologies, different ways of working would come\r\nup. Thus, \"disparate\" which means different fits the\r\nblank appropriately.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>The concerned sentence mentions \"more productive\r\nways of\". This means that with the development of\r\ntechnologies, different ways of working would come\r\nup. Thus, \"disparate\" which means different fits the\r\nblank appropriately.<br></p>', 1, 'abc', 1, 0),
(18856, 18936, 0, 1, 0, 'Your answer is correct.<p>Sol:</p><p>A- The use of present perfect continuous tense is\r\nincorrect, because perfect tense used when there is&nbsp;a point of reference in time. So, option A is wrong.&nbsp;</p><p>B- The sentence gives a sense that the the flag was\r\nbeing waved in support of Germany\'s defeat in a\r\ngame that took place outside the embassy. Games\r\nare not played outside embassies, neither are flags\r\nwaved supporting anyone\'s defeat. So, option B is\r\nwrong. Also, \"thanking\" is wrong and \"thanked\"\r\nshould be used to maintain parallelism.&nbsp;</p><p>C- \'During\' is used to show duration. in the given\r\nsentence, a single point is being mentioned. In such\r\ncases, \'when\' should be used. So, option C is\r\nwrong.&nbsp;</p><p>D- \'Break down in tears\' means having a sudden\r\nemotional outburst. Also \'which\' is used to join two\r\nclauses, always followed by present simple tense.&nbsp;</p><p>So, option E is also wrong<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p><p>A- The use of present perfect continuous tense is incorrect, because perfect tense used when there is&nbsp;a point of reference in time. So, option A is wrong.&nbsp;</p><p>B- The sentence gives a sense that the the flag was being waved in support of Germany\'s defeat in a game that took place outside the embassy. Games are not played outside embassies, neither are flags waved supporting anyone\'s defeat. So, option B is wrong. Also, \"thanking\" is wrong and \"thanked\" should be used to maintain parallelism.&nbsp;</p><p>C- \'During\' is used to show duration. in the given sentence, a single point is being mentioned. In such cases, \'when\' should be used. So, option C is wrong.&nbsp;</p><p>D- \'Break down in tears\' means having a sudden emotional outburst. Also \'which\' is used to join two clauses, always followed by present simple tense.&nbsp;</p><p>So, option E is also wrong</p><br></p>', 1, 'abc', 1, 0),
(18857, 18937, 0, 1, 0, 'Your answer is correct.<p>Sol:</p><p>\'To\' is a preposition. \'Too\' is the correct word is to\r\nbe used. \'Too\' is an adverb which means to a higher\r\ndegree than is desirable, permissible, or possible;\r\nexcessively. Also, \'or\' is wrongly used here. We\r\nwant to use \'and\' because we want to denote both\r\nflora and fauna. so, option A is wrong.\r\n\'Throughout\' means \'throughout the whole of\',\r\nwhile \'during\' can mean \'at some point during\'.\r\nSince, forts were not built that often. So, option B\r\nis wrong.<br></p><p>Since, \'hundred\' is being used here as an adjective,\r\nits should be plural because the noun (corridors) is\r\nplural.&nbsp;</p><p>So, option C is wrong.\r\n\'</p><p>Separates the Ladakh and Karakoram mountain\r\nranges\' is a descriptive clause and it lacks \'that\'.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>\'To\' is a preposition. \'Too\' is the correct word is to\r\nbe used. \'Too\' is an adverb which means to a higher\r\ndegree than is desirable, permissible, or possible;\r\nexcessively. Also, \'or\' is wrongly used here. We\r\nwant to use \'and\' because we want to denote both\r\nflora and fauna. so, option A is wrong.\r\n\'Throughout\' means \'throughout the whole of\',\r\nwhile \'during\' can mean \'at some point during\'.\r\nSince, forts were not built that often. So, option B\r\nis wrong.<br></p><p>Since, \'hundred\' is being used here as an adjective,\r\nits should be plural because the noun (corridors) is\r\nplural.&nbsp;</p><p>So, option C is wrong.&nbsp;</p><p>\'Separates the Ladakh and Karakoram mountain\r\nranges\' is a descriptive clause and it lacks \'that\'.<br></p>', 1, 'abc', 1, 0),
(18858, 18938, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>The announcement took place in the past (known\r\nby the use of simple past for the main verbannounce), so the tense following it should be past\r\nperfect. Past perfect because the action of\r\nbreathing a sigh of relief depends on the\r\nannouncement. so, option A is wrong.<br></p><p>\'Who\' is used to refer to the subject of the verb\r\nwhereas whom should be used to refer to the\r\nobject of a verb. \'Arun Jaitley\' is the object in\r\noption C, so whom should be used. So, option C s\r\nwrong.<br></p><p>\'Which\' is a relative pronoun used for add\r\ndescriptive clause. These clauses start with simple\r\npresent tense. So, option is D is wrong.\r\n\'Because\' is used for giving reasons. the second&nbsp;part of option C isn\'t any reason, but rather a\r\nparallel activity, where \'as\' should be used. so,\r\noption E is wrong.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol:</p><p>The announcement took place in the past (known by the use of simple past for the main verb announce), so the tense following it should be past perfect. Past perfect because the action of breathing a sigh of relief depends on the announcement. so, option A is wrong.<br></p><p>\'Who\' is used to refer to the subject of the verb whereas whom should be used to refer to the object of a verb. \'Arun Jaitley\' is the object in option C, so whom should be used. So, option C s wrong.<br></p><p>\'Which\' is a relative pronoun used for add descriptive clause. These clauses start with simple present tense. So, option is D is wrong. \'Because\' is used for giving reasons. the second&nbsp;part of option C isn\'t any reason, but rather a parallel activity, where \'as\' should be used. so, option E is wrong.</p><br></p>', 1, 'abc', 1, 0),
(18859, 18939, 0, 1, 0, 'Your answer is correct.<p><p>Sol:</p><p>Will is an auxiliary verb that is used to denote future tense. but, if we want to denote an action that would become past in the future, we use \'would\'. The meeting is yet to be held, so we should use \'will. so, option B is wrong. The usage f \'about\' and \'with\' is incorrect in the given sentence.<br></p><p>Every is used to denote the whole group as one, but, option D talks about individuals who display unruly behaviour. in such cases \'each\' should be used. so, option D is wrong.&nbsp;</p><p>\'What\' is used to add descriptive clause. \'That is home to close to 7 lakh Indians \' is not a descriptive clause. Thus, \'which\' should be used. Also, it should be \'after\' instead of \"following to convey a sequence of events in the best manner.</p><br></p>', 1, 'Your answer is partially correct.<p><br></p>', 1, 'Your answer is incorrect.<p><p>Sol:</p><p>Will is an auxiliary verb that is used to denote future tense. but, if we want to denote an action that would become past in the future, we use \'would\'. The meeting is yet to be held, so we should use \'will. so, option B is wrong. The usage f \'about\' and \'with\' is incorrect in the given sentence.<br></p><p>Every is used to denote the whole group as one, but, option D talks about individuals who display unruly behaviour. in such cases \'each\' should be used. so, option D is wrong.&nbsp;</p><p>\'What\' is used to add descriptive clause. \'That is home to close to 7 lakh Indians \' is not a descriptive clause. Thus, \'which\' should be used. Also, it should be \'after\' instead of \"following to convey a sequence of events in the best manner.</p><br></p>', 1, 'abc', 1, 0),
(18860, 18940, 0, 1, 0, 'Your answer is correct.<p>Sol:</p><p>\'Being\' implies that the couple in option A are the\r\nsubject of dabbling. But, they have \'dabbled\' in the\r\npast, so \'having\' is the correct verb to be used.\r\nAlso, they have done so many advertisements\r\ntogether, so they are definitely not strangers.&nbsp;</p><p>Hence, option a is wrong<br></p><p>In option B, \'be\' after \'to\' is missing. So, option B is\r\nwrong.<br></p><p>Both the verbs \'protect\' and \'encourage\' must be of\r\nsame tense because they are two actions that took\r\nplace under same conditions at the same time.&nbsp;</p><p>so,\r\noption D is wrong.<br></p><p>Option E uses the base form of verb \'become\'. it\r\nshould be either \'has become\' or becomes.&nbsp;</p><p>so,\r\noption E is wrong.&nbsp;</p><p><br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p><p>Sol:</p><p>\'Being\' implies that the couple in option A are the subject of dabbling. But, they have \'dabbled\' in the past, so \'having\' is the correct verb to be used. Also, they have done so many advertisements together, so they are definitely not strangers.&nbsp;</p><p>Hence, option a is wrong<br></p><p>In option B, \'be\' after \'to\' is missing. So, option B is wrong.<br></p><p>Both the verbs \'protect\' and \'encourage\' must be of same tense because they are two actions that took place under same conditions at the same time.&nbsp;</p><p>so, option D is wrong.<br></p><p>Option E uses the base form of verb \'become\'. it should be either \'has become\' or becomes.&nbsp;</p><p>so, option E is wrong.&nbsp;</p><br></p>', 1, 'abc', 1, 0),
(18861, 18941, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>The 2019 G20 Tokyo summit will be the fourteenth \r\nmeeting of Group of Twenty (G20). It will be held in \r\n2019 in the city of Tokyo. It will be the first-ever \r\nG20 summit to be hosted in Japan.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>The 2019 G20 Tokyo summit will be the fourteenth \r\nmeeting of Group of Twenty (G20). It will be held in \r\n2019 in the city of Tokyo. It will be the first-ever \r\nG20 summit to be hosted in Japan.<br></p>', 1, 'abc', 1, 0),
