(18904, 18984, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>Let the principal given by A to B = 100P&nbsp;</p><p>R = 10%&nbsp;</p><p>T = 1year&nbsp;</p><p>Amount which B has to pay = 100P(1 + r/100)=&nbsp;</p><p>&nbsp;100P(1 + 10/100) = 110P&nbsp;</p><p>Now, B gives it to a bank&nbsp;</p><p>Principal = 100P&nbsp;</p><p>R = 20%&nbsp;</p><p>But it is compounded half yearly.&nbsp;</p><p>∴R1 = (20/2)% = 10%&nbsp;</p><p>T1 = 2T = 2*1 = 2&nbsp;</p><p>Amount which bank has to refund to B = 100P(1 + \r\n10/100)2 = 121P&nbsp;</p><p>Bank distribute the Principal amount to C and D in&nbsp;</p><p>&nbsp;ratio = 2:3&nbsp;</p><p>Share of C = (100P/5)*2 = 40P&nbsp;</p><p>Share of D = (100P/5)*3 = 60P&nbsp;</p><p>R = 25%&nbsp;</p><p>T = 1 year<br></p><p>Amount to be returned by C = 40P(1 +25/100) = \r\n50P&nbsp;</p><p>Amount to be returned by D = 60P(1 +25/100) = \r\n75P&nbsp;</p><p>Amount received by bank = 125P&nbsp;</p><p>Profit of bank = Amount received by bank - Amount&nbsp;</p><p>&nbsp;which bank has to refund to B = 125P – 121P = 4P\r\nProfit of bank = Rs 2640[Given]&nbsp;</p><p>4P =2640&nbsp;</p><p>P = 660&nbsp;</p><p>Amount invested by A = 100P = 100*660 = Rs \r\n66000<br></p><p><br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Let the principal given by A to B = 100P&nbsp;</p><p>R = 10%&nbsp;</p><p>T = 1year&nbsp;</p><p>Amount which B has to pay = 100P(1 + r/100)= \r\n100P(1 + 10/100) = 110P&nbsp;</p><p>Now, B gives it to a bank\r\nPrincipal = 100P&nbsp;</p><p>R = 20%&nbsp;</p><p>But it is compounded half yearly.&nbsp;</p><p>∴R1 = (20/2)% = 10%&nbsp;</p><p>T1 = 2T = 2*1 = 2&nbsp;</p><p>Amount which bank has to refund to B = 100P(1 + \r\n10/100)2 = 121P&nbsp;</p><p>Bank distribute the Principal amount to C and D in \r\nratio = 2:3&nbsp;</p><p>Share of C = (100P/5)*2 = 40P&nbsp;</p><p>Share of D = (100P/5)*3 = 60P&nbsp;</p><p>R = 25%&nbsp;</p><p>T = 1 year<br></p><p>Amount to be returned by C = 40P(1 +25/100) = \r\n50P&nbsp;</p><p>Amount to be returned by D = 60P(1 +25/100) = \r\n75P&nbsp;</p><p>Amount received by bank = 125P&nbsp;</p><p>Profit of bank = Amount received by bank - Amount \r\nwhich bank has to refund to B = 125P – 121P = 4P\r\nProfit of bank = Rs 2640[Given]&nbsp;</p><p>4P =2640&nbsp;</p><p>P = 660&nbsp;</p><p>Amount invested by A = 100P = 100*660 = Rs \r\n66000<br></p><p><br></p>', 1, 'abc', 1, 0),
(18905, 18985, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>Event A1 it rains on party day&nbsp;</p><p>Event A2 it does not rain on party day&nbsp;</p><p>Event B the man predicted rain&nbsp;</p><p>Therefore P(A1)= 5/365=0.014 and \r\nP(A2)=360/365=0.9863&nbsp;</p><p>P(B/A1)= 0.9 [forecasts of 90% rain ]&nbsp;</p><p>P(B/A2)=0.1[when it not rain]&nbsp;Now, using formula</p><p>P(A1/B)=P(A1)P(B/A1)/[&nbsp;</p><p>&nbsp;P(A1)P(B/A1)+ P(A2)</p><p>P(B/A2)]\r\n=0.014*0.9/(0.014*0.9 +0.986*0.1)</p><p>&nbsp;=0.111<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Event A1 it rains on party day&nbsp;</p><p>Event A2 it does not rain on party day&nbsp;</p><p>Event B the man predicted rain&nbsp;</p><p>Therefore P(A1)= 5/365=0.014 and&nbsp;</p><p>&nbsp;P(A2)=360/365=0.9863&nbsp;</p><p>P(B/A1)= 0.9 [forecasts of 90% rain ]</p><p>&nbsp;P(B/A2)=0.1[when it not rain]&nbsp;</p><p>Now, using formula&nbsp;</p><p>P(A1/B)=P(A1)P(B/A1)/[&nbsp;</p><p>&nbsp;P(A1)P(B/A1)+ P(A2)</p><p>P(B/A2)]\r\n=0.014*0.9/(0.014*0.9 +0.986*0.1)&nbsp;</p><p>=0.111<br></p><p><br></p>', 1, 'abc', 1, 0),
(18906, 18986, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>As the size of the room is 40*48 , the square tile \r\nmaximum size will be of 8 ft * 8 ft which is the \r\ncommon factor of 40 and 48.\r\nMinimum number of square tiles required are 40 * \r\n48 / 64 = 30<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>As the size of the room is 40*48 , the square tile \r\nmaximum size will be of 8 ft * 8 ft which is the \r\ncommon factor of 40 and 48.\r\nMinimum number of square tiles required are 40 * \r\n48 / 64 = 30<br></p>', 1, 'abc', 1, 0),
(18907, 18987, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>Let the age of Ameer and Sharukh be A years and S \r\nyears respectively&nbsp;</p><p>A = 5/3 S\r\nS = 3</p><p>(S-(A-S))&nbsp;</p><p>&nbsp;S= 6S - 3A&nbsp;</p><p>=&gt; 5S = 3A</p><p>&nbsp;If we observe above equations both are dependant \r\nequations. Hence more than one answer can be \r\nobtained. So the answer is Data insufficient.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Let the age of Ameer and Sharukh be A years and S \r\nyears respectively&nbsp;</p><p>A = 5/3 S&nbsp;</p><p>S= 3(S-(A-S))</p><p>&nbsp;S = 6S - 3A&nbsp;</p><p>=&gt; 5S = 3A</p><p>&nbsp;If we observe above equations both are dependant \r\nequations. Hence more than one answer can be \r\nobtained. So the answer is Data insufficient.<br></p>', 1, 'abc', 1, 0),
