(18914, 18994, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>Compound interest (two years) = Simple interest \r\n(two years) + Rs. 1050&nbsp;</p><p>Simple interest (two years) = 8000&nbsp;</p><p>So, compound interest earned at the end of two \r\nyears = 8000 + 1050 = 9050&nbsp;</p><p>So option (b) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Compound interest (two years) = Simple interest \r\n(two years) + Rs. 1050&nbsp;</p><p>Simple interest (two years) = 8000&nbsp;</p><p>So, compound interest earned at the end of two \r\nyears = 8000 + 1050 = 9050&nbsp;</p><p>So option (b) is the correct answer.<br></p>', 1, 'abc', 1, 0),
