(18916, 18996, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>As he increases his weight by 25 %.&nbsp;</p><p>We do not even need the original weight here to \r\nevaluate the required correction actually.&nbsp;</p><p>Let his original weight is 100Kg and as he increases&nbsp;</p><p>&nbsp;his weight by 25 % then his weight becomes 125&nbsp;</p><p>If we come back to the original weight then we&nbsp;</p><p>&nbsp;have to do 20% reduction in the stated weight.&nbsp;</p><p>Alternative:&nbsp;</p><p>The required percentage decrease is given as = \r\n[x/(100+x)]*100&nbsp;</p><p>where, x is the percentage increase which is 25, so \r\nRequired Correction = (25/125)*100 = 20% \r\ndecrease<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>As he increases his weight by 25 %.&nbsp;</p><p>We do not even need the original weight here to \r\nevaluate the required correction actually.&nbsp;</p><p>Let his original weight is 100Kg and as he increases&nbsp;</p><p>&nbsp;his weight by 25 % then his weight becomes 125&nbsp;</p><p>If we come back to the original weight then we&nbsp;</p><p>&nbsp;have to do 20% reduction in the stated weight.&nbsp;</p><p>Alternative:&nbsp;</p><p>The required percentage decrease is given as = \r\n[x/(100+x)]*100&nbsp;</p><p>where, x is the percentage increase which is 25, so \r\nRequired Correction = (25/125)*100 = 20% \r\ndecrease<br></p>', 1, 'abc', 1, 0),
