(18925, 19005, 0, 1, 0, 'Your answer is correct.<p>Sol:</p><p>Electronic Data Interchange (EDI) is the process of\r\nusing computers to exchange business documents\r\nbetween companies. Previously, fax machines or\r\ntraditional mail was used to exchange documents.\r\nMailing and faxing are still used in business, but\r\nEDI is a much quicker way to do the same thing.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Electronic Data Interchange (EDI) is the process of\r\nusing computers to exchange business documents\r\nbetween companies. Previously, fax machines or\r\ntraditional mail was used to exchange documents.\r\nMailing and faxing are still used in business, but\r\nEDI is a much quicker way to do the same thing.<br></p>', 1, 'abc', 1, 0),
