(18934, 19014, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>The smallest unit of data on a binary computer or\r\ndigital system is a single bit. Bit an abbreviation for\r\nBinary digit can hold either a 0 and a 1.&nbsp;</p><p>Note:- A bit is the smallest unit of information a\r\ncomputer can understand.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>The smallest unit of data on a binary computer or\r\ndigital system is a single bit. Bit an abbreviation for\r\nBinary digit can hold either a 0 and a 1.&nbsp;</p><p>Note:- A bit is the smallest unit of information a\r\ncomputer can understand.<br></p>', 1, 'abc', 1, 0),
