(18936, 19016, 0, 1, 0, 'Your answer is correct.<p>Sol:</p><p>Page orientation is the way in which a rectangular\r\npage is oriented for normal viewing. The two most\r\ncommon types of orientation are portrait and\r\nlandscape. The specific word definition comes from\r\nthe fact that a close-up portrait of a person\'s face\r\nand upper body is more fitting for a canvas or\r\nphoto where the height of the display area is\r\ngreater than the width, and is more common for\r\nthe pages of books. Landscape originally described\r\nartistic outdoor scenes where a wide view area is\r\nneeded, but the upper part of the painting would be\r\nmostly sky and so is omitted.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Page orientation is the way in which a rectangular\r\npage is oriented for normal viewing. The two most\r\ncommon types of orientation are portrait and\r\nlandscape. The specific word definition comes from\r\nthe fact that a close-up portrait of a person\'s face\r\nand upper body is more fitting for a canvas or\r\nphoto where the height of the display area is\r\ngreater than the width, and is more common for\r\nthe pages of books. Landscape originally described\r\nartistic outdoor scenes where a wide view area is\r\nneeded, but the upper part of the painting would be\r\nmostly sky and so is omitted.<br></p>', 1, 'abc', 1, 0),
