(18981, 19061, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>Dry Apples sold on Monday = Number of Appleswet Apples sold on Monday&nbsp;</p><p>= 1120 -765 = 355</p><p>&nbsp;Dry Apples sold on Saturday = Number of Appleswt Apples sold on Saturday</p><p>&nbsp;= 1190 -720 = 470&nbsp;</p><p>Required ratio = 355:470 = 71:94<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>Dry Apples sold on Monday = Number of Appleswet Apples sold on Monday&nbsp;</p><p>= 1120 -765 = 355&nbsp;</p><p>Dry Apples sold on Saturday = Number of Appleswt Apples sold on Saturday&nbsp;</p><p>= 1190 -720 = 470&nbsp;</p><p>Required ratio = 355:470 = 71:94<br></p>', 1, 'abc', 1, 0),
