(18999, 19079, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>At first it may seem statement I is the cause and II \r\nis effect, but the reduction in accident cannot be \r\nhappening not just because of new traffic light. \r\nKochi had old system of traffic light system, the \r\nnew system is to curb road blocks. And reduction in \r\naccident can be mainly caused by well-maintained \r\nroad, speed limits, strict checking not just by new \r\ntraffic light system. Statement I is caused by \r\nincreasing traffic block and II by any of the above \r\nmentioned reasons, so both statements are effects \r\nwith independent causes.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>At first it may seem statement I is the cause and II \r\nis effect, but the reduction in accident cannot be \r\nhappening not just because of new traffic light. \r\nKochi had old system of traffic light system, the \r\nnew system is to curb road blocks. And reduction in \r\naccident can be mainly caused by well-maintained \r\nroad, speed limits, strict checking not just by new \r\ntraffic light system. Statement I is caused by \r\nincreasing traffic block and II by any of the above \r\nmentioned reasons, so both statements are effects \r\nwith independent causes.<br></p>', 1, 'abc', 1, 0),
(19000, 19080, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>Both assumptions I and II are valid. The statement \r\nsays that people are returning to “what is left of \r\ntheir homes”, from which we can assume that their \r\nhomes were almost destroyed. Similarly, because \r\nthe families are returning to the city, we can \r\nassume that they were driven away or left when \r\nIsis took over their city. However, assumption III is \r\nnot valid as we cannot assume if all of the residents \r\nhad left and none of them supported Isis from the \r\ngiven statement. Hence, option D is the correct \r\nanswer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>Both assumptions I and II are valid. The statement \r\nsays that people are returning to “what is left of \r\ntheir homes”, from which we can assume that their \r\nhomes were almost destroyed. Similarly, because \r\nthe families are returning to the city, we can \r\nassume that they were driven away or left when \r\nIsis took over their city. However, assumption III is \r\nnot valid as we cannot assume if all of the residents \r\nhad left and none of them supported Isis from the \r\ngiven statement. Hence, option D is the correct \r\nanswer.<br></p>', 1, 'abc', 1, 0),
