(19009, 19089, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>Both the inferences can be correctly inferred. The \r\ngiven statement says that due to climate changes \r\nsea levels are rising and because of this, more than \r\nthree hundred thousand homes will get flooded \r\nevery two weeks in the next 30 years. I is an \r\nobvious deduction – people who live near the&nbsp;coastlines will be financially and emotionally \r\naffected. And II can also be clearly inferred – to \r\ncombat this situation, greenhouse gas emissions \r\nthat are the main cause of rising sea levels, need to \r\nbe curtailed with immediate effect. Therefore, \r\noption C is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>Both the inferences can be correctly inferred. The \r\ngiven statement says that due to climate changes \r\nsea levels are rising and because of this, more than \r\nthree hundred thousand homes will get flooded \r\nevery two weeks in the next 30 years. I is an \r\nobvious deduction – people who live near the&nbsp;coastlines will be financially and emotionally \r\naffected. And II can also be clearly inferred – to \r\ncombat this situation, greenhouse gas emissions \r\nthat are the main cause of rising sea levels, need to \r\nbe curtailed with immediate effect. Therefore, \r\noption C is the correct answer.<br></p>', 1, 'abc', 1, 0),
