(19049, 19129, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>The first sentence states what the soaring \r\ncommodity prices and farm incomes have done to a \r\nparticular sector. If a sector sells products at \r\nelevated costs and if it profits hugely through farm \r\nincomes, the sector will undoubtedly benefit. So, \r\nthe blank requires a word which is positive in \r\nnature. “Weakened”, “diminished”, and “cripple” \r\nare words that convey a negative meaning and \r\ntheir usage would make the sentence meaningless. \r\n“Ease off” plays the similar role and hence it can be \r\ndiscarded. Thus, the correct word is strengthened \r\nand option D is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>The first sentence states what the soaring \r\ncommodity prices and farm incomes have done to a \r\nparticular sector. If a sector sells products at \r\nelevated costs and if it profits hugely through farm \r\nincomes, the sector will undoubtedly benefit. So, \r\nthe blank requires a word which is positive in \r\nnature. “Weakened”, “diminished”, and “cripple” \r\nare words that convey a negative meaning and \r\ntheir usage would make the sentence meaningless. \r\n“Ease off” plays the similar role and hence it can be \r\ndiscarded. Thus, the correct word is strengthened \r\nand option D is the correct answer.<br></p>', 1, 'abc', 1, 0),
(19050, 19130, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>“Aggravating” means making any issue or situation \r\nworse that can turn out to be out of control.\r\n“Exasperate” means infuriate.\r\n“Escalating” means increase rapidly or accelerate.\r\nIt has already been established that soaring farm \r\nincomes have strengthened the sector. This means \r\nthat the farm incomes have increased or escalated. \r\nThus, option A is the correct answer. “Increase” \r\nwould have been a suitable word had it been used \r\nas a verb.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>“Aggravating” means making any issue or situation \r\nworse that can turn out to be out of control.\r\n“Exasperate” means infuriate.\r\n“Escalating” means increase rapidly or accelerate.\r\nIt has already been established that soaring farm \r\nincomes have strengthened the sector. This means \r\nthat the farm incomes have increased or escalated. \r\nThus, option A is the correct answer. “Increase” \r\nwould have been a suitable word had it been used \r\nas a verb.<br></p>', 1, 'abc', 1, 0),
(19051, 19131, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>“Sustainability” means the ability to be maintained \r\nat a certain rate or level.\r\n“Appetite” means a strong desire or liking for \r\nsomething (especially food)\r\n“Aversion” means a strong dislike or disinclination.\r\nIt has already been stated that increased farm \r\nincomes and low interest rates have led to a recent \r\nsurge in farmland values. The sentence carrying the \r\nthird blank states that if this trend continues, \r\nsomething may happen to the higher farmland \r\nvalues. Clearly, higher farm value will continue to \r\nexist as they do if this trend continues. So \r\n‘sustainability’ is the best fit word and option E is \r\nthe correct answer.</p><p><br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>“Sustainability” means the ability to be maintained \r\nat a certain rate or level.\r\n“Appetite” means a strong desire or liking for \r\nsomething (especially food)\r\n“Aversion” means a strong dislike or disinclination.\r\nIt has already been stated that increased farm \r\nincomes and low interest rates have led to a recent \r\nsurge in farmland values. The sentence carrying the \r\nthird blank states that if this trend continues, \r\nsomething may happen to the higher farmland \r\nvalues. Clearly, higher farm value will continue to \r\nexist as they do if this trend continues. So \r\n‘sustainability’ is the best fit word and option E is \r\nthe correct answer.<br></p>', 1, 'abc', 1, 0),
(19052, 19132, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>Validate” means demonstrate or support the truth \r\nor value of, while “apex” means the top or highest \r\npart of something, especially one forming a point. \r\nThe sentence talks about statistics that bring to \r\nlight the risks that are faced by agriculture banks. \r\nSo, ‘highlight’ is the most appropriate word to fit \r\nthe blank. “Apex”, “prove” and “validate” don’t \r\nconvey the same meaning and make the sentence \r\nentirely vague and out of context. “Points off” is an \r\nincorrect phrasal verb.\r\nHence, B is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>Validate” means demonstrate or support the truth \r\nor value of, while “apex” means the top or highest \r\npart of something, especially one forming a point. \r\nThe sentence talks about statistics that bring to \r\nlight the risks that are faced by agriculture banks. \r\nSo, ‘highlight’ is the most appropriate word to fit \r\nthe blank. “Apex”, “prove” and “validate” don’t \r\nconvey the same meaning and make the sentence \r\nentirely vague and out of context. “Points off” is an \r\nincorrect phrasal verb.\r\nHence, B is the correct answer.<br></p>', 1, 'abc', 1, 0),
(19053, 19133, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>“Collateral” means additional but subordinate or \r\nsomething pledged as security for repayment of a \r\nloan, to be forfeited in the event of a default.\r\n“Pawn” means a person used by others for their \r\nown purposes. “Descended” means to make a \r\nsudden attack on someone.\r\nGiven the economic context of the passage, the \r\nusage of ‘pawn’ an ‘descendent’ will be incorrect. \r\nHowever, “collateral” will make a logical sense. \r\n“Core” and “authentic”, when used with the noun \r\n\"values\", reflects on the fundamental beliefs of a \r\nperson.\r\nHence, C is correct.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol:</p><p>“Collateral” means additional but subordinate or \r\nsomething pledged as security for repayment of a \r\nloan, to be forfeited in the event of a default.\r\n“Pawn” means a person used by others for their \r\nown purposes. “Descended” means to make a \r\nsudden attack on someone.\r\nGiven the economic context of the passage, the \r\nusage of ‘pawn’ an ‘descendent’ will be incorrect. \r\nHowever, “collateral” will make a logical sense. \r\n“Core” and “authentic”, when used with the noun \r\n\"values\", reflects on the fundamental beliefs of a \r\nperson.\r\nHence, C is correct.<br></p>', 1, 'abc', 1, 0),
(19054, 19134, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>Constitute” means to combine to form, while \r\n“accumulate” means gather together or acquire an \r\nincreasing number or quantity of. “Escalate” means \r\nmake or become more intense or serious; \r\n“exacerbate” means make some situation worse, \r\nand “dwindle” means diminish gradually in size, \r\namount, or strength. The sentence conveys the \r\nidea that the loans secured by farmland combine toform more than twice the amount of credits for \r\nagriculture production.\r\nHence, option E is the correct answer.</p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>Constitute” means to combine to form, while \r\n“accumulate” means gather together or acquire an \r\nincreasing number or quantity of. “Escalate” means \r\nmake or become more intense or serious; \r\n“exacerbate” means make some situation worse, \r\nand “dwindle” means diminish gradually in size, \r\namount, or strength. The sentence conveys the \r\nidea that the loans secured by farmland combine toform more than twice the amount of credits for \r\nagriculture production.\r\nHence, option E is the correct answer.</p>', 1, 'abc', 1, 0),
(19055, 19135, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>“Fortified” means provide with defensive works as \r\nprotection against attack or secure, while \r\n“authenticated” means to prove or show \r\n(something) to be true, genuine, or valid. \r\n“Corroborate” means confirm or give support to, \r\nwhile “ratify” means give consent to. Since the \r\nloans secured by farmland constitute twice the \r\namount of credit extended, the agricultural loans \r\nfrom these banks are saved/ protected/ fortified \r\nfrom risk by the farm real estate.\r\nHence, A is correct.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>“Fortified” means provide with defensive works as \r\nprotection against attack or secure, while \r\n“authenticated” means to prove or show \r\n(something) to be true, genuine, or valid. \r\n“Corroborate” means confirm or give support to, \r\nwhile “ratify” means give consent to. Since the \r\nloans secured by farmland constitute twice the \r\namount of credit extended, the agricultural loans \r\nfrom these banks are saved/ protected/ fortified \r\nfrom risk by the farm real estate.\r\nHence, A is correct.<br></p>', 1, 'abc', 1, 0),
(19056, 19136, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>“Surging” means increase suddenly, while \r\n“diminish” means less valuable. “Curtail” means to \r\nimpose a restriction on, while “retrench” means \r\nreduce costs or spending in response to economic \r\ndifficulty. Throughout the passage, it has been \r\nestablished that farmland values are on a rise, so \r\n‘surging’ is the most appropriate answer. Option C \r\nis correct.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>“Surging” means increase suddenly, while \r\n“diminish” means less valuable. “Curtail” means to \r\nimpose a restriction on, while “retrench” means \r\nreduce costs or spending in response to economic \r\ndifficulty. Throughout the passage, it has been \r\nestablished that farmland values are on a rise, so \r\n‘surging’ is the most appropriate answer. Option C \r\nis correct.<br></p>', 1, 'abc', 1, 0),
(19057, 19137, 0, 1, 1, 'Your answer is correct.<p>Sol:</p><p>“Censorious” means severely critical of others, \r\nwhile “pedantic” means excessively concerned with \r\nminor details or rules or over-scrupulous. \r\n“Quintessential” means representing the most \r\nperfect or typical example of a quality or class and \r\n“conventional” means based on or in accordance \r\nwith what is generally done or believed. The \r\nsentence reflects the tone of the paragraph, which \r\nis positive, and hence, the factors are proven to be \r\nfavourable for the agriculture banks. The other \r\noptions don’t match the tone of the passage. \r\nHence, option D is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>“Censorious” means severely critical of others, \r\nwhile “pedantic” means excessively concerned with \r\nminor details or rules or over-scrupulous. \r\n“Quintessential” means representing the most \r\nperfect or typical example of a quality or class and \r\n“conventional” means based on or in accordance \r\nwith what is generally done or believed. The \r\nsentence reflects the tone of the paragraph, which \r\nis positive, and hence, the factors are proven to be \r\nfavourable for the agriculture banks. The other \r\noptions don’t match the tone of the passage. \r\nHence, option D is the correct answer.<br></p>', 1, 'abc', 1, 0),
(19058, 19138, 0, 1, 1, 'Your answer is correct.<p>Sol;</p><p>In economic terms, “volatility” means the liability to \r\nchange rapidly and unpredictably, especially for the \r\nworse. “Dispersion” means the action or process of \r\ndistributing things or people over a wide area. \r\n“Transitory” means not permanent, while “outlay” \r\nmeans an amount of money spent on something. \r\nThe sentence states a negative effect of \r\nconcentration in any economic sector and volatility \r\nis the best fit answer. Hence, B is correct.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol;</p><p>In economic terms, “volatility” means the liability to \r\nchange rapidly and unpredictably, especially for the \r\nworse. “Dispersion” means the action or process of \r\ndistributing things or people over a wide area. \r\n“Transitory” means not permanent, while “outlay” \r\nmeans an amount of money spent on something. \r\nThe sentence states a negative effect of \r\nconcentration in any economic sector and volatility \r\nis the best fit answer. Hence, B is correct.<br></p>', 1, 'abc', 1, 0),
