 ‘Regiment’ is a verb which means to \r\norganize according to a strict system or pattern. \r\nSo, ‘coerce’ is also correctly used.\r\nThe expression “climate was jingoistic by a \r\ndiscourse” sounds erroneous. Thus, ‘jingoistic’ is \r\nincorrect at (1). Similarly, “buttressed” is not an \r\napt adjective for “appeals”. If the places of \r\n“jingoistic” and “buttressed” are interchanged, the \r\nsentence will convey proper sense.<br></p>', 1, 'abc', 1, 0),
