(20227, 20310, 0, 1, 0, 'Your answer is correct.<p>Sol. The hint for the answer is derived from the paragraph where it is given as “considering something like \r\nIQ to be a sufficient index of human mental capacity!” An intelligence quotient (IQ) is a total score derived \r\nfrom several standardized tests designed to assess human intelligence. Option (d) is out of context hence \r\ncan be omitted easily. Only option (b) has talked about the ‘human intelligence.’ \r\nHence, the option (b) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. The hint for the answer is derived from the paragraph where it is given as “considering something like \r\nIQ to be a sufficient index of human mental capacity!” An intelligence quotient (IQ) is a total score derived \r\nfrom several standardized tests designed to assess human intelligence. Option (d) is out of context hence \r\ncan be omitted easily. Only option (b) has talked about the ‘human intelligence.’ \r\nHence, the option (b) is the correct answer.<br></p>', 1, 'abc', 1, 0),
(20228, 20311, 0, 1, 1, 'Your answer is correct.<p>Sol. The position of (2) (intelligence) and (3) (different) seems correct, but the words ‘activity’ and \r\n‘failures’ seem to be incorrectly placed. Hence, upon interchanging 1-4, we get the sentence, grammatically \r\nand contextually correct and meaningful, repectively. The sentence thus formed will be, “One of the major \r\nfailures here is that of considering intelligence to be something different from and raised above the activity \r\nof living.”\r\nHence, the option (c) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. The position of (2) (intelligence) and (3) (different) seems correct, but the words ‘activity’ and \r\n‘failures’ seem to be incorrectly placed. Hence, upon interchanging 1-4, we get the sentence, grammatically \r\nand contextually correct and meaningful, repectively. The sentence thus formed will be, “One of the major \r\nfailures here is that of considering intelligence to be something different from and raised above the activity \r\nof living.”\r\nHence, the option (c) is the correct answer.<br></p>', 1, 'abc', 1, 0),
(20229, 20312, 0, 1, 1, 'Your answer is correct.<p>Sol. relegated- assign an inferior rank or position to\r\nThe hint for the answer can be derived from the line itself. “This leads \r\nto the misconception that intelligence can be ………….. to something \r\nelse — say, a robot — without becoming something else.”\r\nIt explains that there is a misconception that a robot can replace the \r\n‘intelligence’ or ‘intelligence’ can be degraded to a lower position. \r\nAmong the given options, the word ‘relegated’ gels well with the \r\ntheme of the paragraph and makes the sentence grammatically and \r\ncontextually correct and meaningful, respectively. Hence, the option \r\n(b) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. relegated- assign an inferior rank or position to\r\nThe hint for the answer can be derived from the line itself. “This leads \r\nto the misconception that intelligence can be ………….. to something \r\nelse — say, a robot — without becoming something else.”\r\nIt explains that there is a misconception that a robot can replace the \r\n‘intelligence’ or ‘intelligence’ can be degraded to a lower position. \r\nAmong the given options, the word ‘relegated’ gels well with the \r\ntheme of the paragraph and makes the sentence grammatically and \r\ncontextually correct and meaningful, respectively. Hence, the option \r\n(b) is the correct answer.<br></p>', 1, 'abc', 1, 0),
(20230, 20313, 0, 1, 1, 'Your answer is correct.<p>Sol. Virtues- behaviour showing high moral standards.\r\nfortes- a thing at which someone excels.\r\nGentry- people of good social position, specifically the class of people next below the nobility in position \r\nand birth.\r\nRage- violent uncontrollable anger.\r\nAmong the given options, the option (b) ‘fortes’ is the most appropriate word to fill the blank. Hence, the \r\noption (b) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. Virtues- behaviour showing high moral standards.\r\nfortes- a thing at which someone excels.\r\nGentry- people of good social position, specifically the class of people next below the nobility in position \r\nand birth.\r\nRage- violent uncontrollable anger.\r\nAmong the given options, the option (b) ‘fortes’ is the most appropriate word to fill the blank. Hence, the \r\noption (b) is the correct answer.<br></p>', 1, 'abc', 1, 0),
(20231, 20314, 0, 1, 1, 'Your answer is correct.<p>Sol.(I) We expect individuals to be their own leaders, to take charge of their lives, to assume responsibility \r\nfor their decisions.\r\n(II) A person who merely coordinates the actions of others or has management skills is not a leader.\r\n(III) I suppose there is little new one can say on this matter.\r\nBCA will be the correct sequence. Hence, the option (c) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol.(I) We expect individuals to be their own leaders, to take charge of their lives, to assume responsibility \r\nfor their decisions.\r\n(II) A person who merely coordinates the actions of others or has management skills is not a leader.\r\n(III) I suppose there is little new one can say on this matter.\r\nBCA will be the correct sequence. Hence, the option (c) is the correct answer.<br></p>', 1, 'abc', 1, 0),
