(20233, 20316, 0, 1, 0, 'Your answer is correct.<p>Sol. Among the given options, only option (d) gels well with the preceding and the following sentences of \r\n(C). The rests seem out-of-context. \r\nHence, the option (d) is the correct answer. \r\n“Since this intellectual formulation can only be the first step, an estimate of the real quality of a decision is \r\nnot known until it is implemented; Its deficiencies begin to show up only when put into practice. This \r\nrequires him to keep his ear to the ground, listen patiently to criticism to judge if his policies are working.”<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. Among the given options, only option (d) gels well with the preceding and the following sentences of \r\n(C). The rests seem out-of-context. \r\nHence, the option (d) is the correct answer. \r\n“Since this intellectual formulation can only be the first step, an estimate of the real quality of a decision is \r\nnot known until it is implemented; Its deficiencies begin to show up only when put into practice. This \r\nrequires him to keep his ear to the ground, listen patiently to criticism to judge if his policies are working.”<br></p>', 1, 'abc', 1, 0);
