(20236, 20319, 0, 1, 1, 'Your answer is correct.<p>Sol. Collusion- secret or illegal cooperation or conspiracy in order to deceive others.\r\nCommotion- a state of confused and noisy disturbance.\r\nConcession- a thing that is granted, especially in response to demands. \r\nDigression- a temporary departure from the main subject in speech or writing.\r\nIt is evident from the whole passage that author is talking about the idea of reconsideration of angel tax on \r\nstart-ups. Only option (c) has a meaning which fits best in the given blank as per the context of the passage. \r\nHence, the option (c) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. Collusion- secret or illegal cooperation or conspiracy in order to deceive others.\r\nCommotion- a state of confused and noisy disturbance.\r\nConcession- a thing that is granted, especially in response to demands. \r\nDigression- a temporary departure from the main subject in speech or writing.\r\nIt is evident from the whole passage that author is talking about the idea of reconsideration of angel tax on \r\nstart-ups. Only option (c) has a meaning which fits best in the given blank as per the context of the passage. \r\nHence, the option (c) is the correct answer.<br></p>', 1, 'abc', 1, 0),
(20237, 20320, 0, 1, 1, 'Your answer is correct.<p>Sol. Norms- something that is usual, typical, or standard.\r\nAmong the given options, the option (d) ‘standards’ is the most \r\nappropriate word to fill the blank. Hence, the option (d) is the correct \r\nanswer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. Norms- something that is usual, typical, or standard.\r\nAmong the given options, the option (d) ‘standards’ is the most \r\nappropriate word to fill the blank. Hence, the option (d) is the correct \r\nanswer.<br></p>', 1, 'abc', 1, 0),
(20238, 20321, 0, 1, 1, 'Your answer is in correct.<p>Sol. BAC will be the correct choice as it will make all the three \r\nsentectes grammatically and contextually correct. \r\n(i) The tax, which was first introduced in 2012 to curb moneylaundering through the sale of shares of private unlisted \r\ncompanies at bloated prices, has caused a lot of anguish among start-up investors in the country.\r\n(ii) For its part, the IT department fears that start-ups may be used as convenient tools to launder illegally \r\nacquired money, so a tax on investments beyond a certain threshold is necessary to deter such shady \r\noperations.\r\n(iii) The broad-brush tax on all investments means an unnecessary cost is imposed on the wider start-up \r\ncommunity simply because of the lack of better means at the government’s disposal to tackle black money.\r\nBAC will be the correct sequence. Hence, the option (d) is the correct answer.<br></p>', 1, 'Your answer is partially correct.&nbsp;', 1, 'Your answer is incorrect.<p>Sol. BAC will be the correct choice as it will make all the three \r\nsentectes grammatically and contextually correct. \r\n(i) The tax, which was first introduced in 2012 to curb moneylaundering through the sale of shares of private unlisted \r\ncompanies at bloated prices, has caused a lot of anguish among start-up investors in the country.\r\n(ii) For its part, the IT department fears that start-ups may be used as convenient tools to launder illegally \r\nacquired money, so a tax on investments beyond a certain threshold is necessary to deter such shady \r\noperations.\r\n(iii) The broad-brush tax on all investments means an unnecessary cost is imposed on the wider start-up \r\ncommunity simply because of the lack of better means at the government’s disposal to tackle black money.\r\nBAC will be the correct sequence. Hence, the option (d) is the correct answer.<br></p>', 1, 'abc', 1, 0),
(20239, 20322, 0, 1, 1, 'Your answer is correct.<p>Sol. The positions of (2) (benefits), (4) (justifiable) and (1) (unintended) and (3) (intent) seems to be \r\nincorrectly placed. Hence, upon interchanging 2-4 and 1-3 we get the sentence which is grammatically and \r\ncontextually correct and meaningful, respectively. “But while the intent of such an angel tax may be \r\njustifiable, the arbitrary nature of it means the cost of unintended consequences could be larger than the \r\nsupposed benefits”\r\nHence, the option (e) is the correct answer.<br></p>', 1, 'Your answer is partially correct.', 1, 'Your answer is incorrect.<p>Sol. The positions of (2) (benefits), (4) (justifiable) and (1) (unintended) and (3) (intent) seems to be \r\nincorrectly placed. Hence, upon interchanging 2-4 and 1-3 we get the sentence which is grammatically and \r\ncontextually correct and meaningful, respectively. “But while the intent of such an angel tax may be \r\njustifiable, the arbitrary nature of it means the cost of unintended consequences could be larger than the \r\nsupposed benefits”\r\nHence, the option (e) is the correct answer.<br></p>', 1, 'abc', 1, 0),
